import React from 'react';
import { useNavigate } from 'react-router-dom';
import classes from './Catalog.module.css';
// import { Context } from 'Context/Context';

export default function Catalog() {
    const navigate = useNavigate();
    const titles = ['первая', 'вторая', 'третья'];
    const nameLink = ['one', 'two', 'three'];
    return (
        <main className={classes.catalog__container}>
            <h3>Каталог</h3>
            <div className={classes.contacts__container}>
                {titles.map((el, id)=> {
                    return <span key = {id+1} className={classes.contacts__cards} onClick={() => navigate(`/${nameLink[id]}>`)}>{el}</span>
                })}
            </div>
        </main>
  );
}
